"use strict";(self.webpackChunkweslley_io=self.webpackChunkweslley_io||[]).push([[4775],{9076:function(e){e.exports=JSON.parse('{"title":"Retrospectiva 2025","slug":"retrospectiva-2025","date":"2025-12-29","authors":["Weslley Ara\xfajo"],"tags":["Retrospectiva"],"content":"\\nEntre **pr\xeamios**, **amizades**, **12 palestras**, n\xfameros **massivos** que ultrapassaram **230 MILH\xd5ES de downloads** em projetos autorais e v\xe1rias **primeiras vezes**, 2025 me levou a lugares t\xe3o incr\xedveis, que facilmente eu poderia manter as coisas assim pra sempre.\\n\\n- Espero que minha hist\xf3ria te inspire e que voc\xea escolha ir muito al\xe9m da zona de conforto \ud83e\udd18\ud83c\udffb\\n\\n{/* truncate */}\\n\\n<hr />\\n\\n## NOVEMBRO 2024: Nos cap\xedtulos anteriores \ud83d\udca1\\n\\n<img src=\'/img/articles/2025/retrospective/01.png\' />\\n\\n> PDS Experience, 30/11 e 01/12/2024 \xbb Hugo Santos (cartaz), Erick Wendel e eu.\\n\\nAcompanhar uma pessoa espec\xedfica, [Hugo Santos](https://www.linkedin.com/in/hugo-santos-sitecore/), me fez perceber que eu estava muito perto de conquistar um objetivo que parecia imposs\xedvel: reconhecimento n\xe3o apenas das pessoas ao meu redor, mas da pr\xf3pria comunidade de desenvolvedores como um todo.\\n\\nN\xe3o era sobre aprender o conte\xfado em si, ele nem sabia da minha exist\xeancia, mas queria me aproximar da comunidade que ele criou. **Era sobre me inspirar:** eu tinha algo incr\xedvel em m\xe3os, mas n\xe3o fazia a menor ideia de como mostrar aquilo para o mundo.\\n\\nNa minha mente, reconhecimento era sobre popularidade e influ\xeancia. Isso me fazia olhar para o lugar errado: projetos com poucas estrelas e redes sociais com poucas intera\xe7\xf5es \ud83d\ude02\\n\\nDo outro lado, meus projetos tinham sido baixados mais de **10 milh\xf5es** de vezes s\xf3 em **2024** e eu n\xe3o percebia o valor disso.\\n\\nDe alguma forma, senti que nessa comunidade eu conseguiria _\\"corrigir\\"_ isso em mim, fui no PDS Experience ([Grupo PDS](https://www.linkedin.com/company/grupopds/posts/?feedView=all)) e, resumidamente, ali eu aprendi na pr\xe1tica:\\n\\n:::note Reconhecimento \xe9 sobre impacto.\\n:::\\n\\nEsse pensamento realmente simples, foi mais que suficiente para mover meu olhar para o lugar certo e isso mudou totalmente como seria meu pr\xf3ximo ano: **2025**.\\n\\n<hr />\\n\\n## Spoilers \ud83c\udf7f\\n\\n- O impacto levou ao reconhecimento, que levou \xe0 popularidade dos meus principais projetos \ud83d\udd25\\n- Em menos de um ano, o n\xfamero saltou de **10 milh\xf5es** para mais de... **230 milh\xf5es** \ud83c\udf1f\\n- Ao todo, palestrei para mais de **3 mil pessoas** _(presencialmente e online)_ \ud83e\udd18\ud83c\udffb\\n\\n<hr />\\n\\n## JANEIRO 2025 \ud83c\udf93\\n\\n<img src=\'/img/articles/2025/retrospective/02.png\' />\\n\\n> Primeira impress\xe3o do site da Awesome You.\\n\\nFundei a [Awesome You](https://awesomeyou.io/) \ud83d\udc1c\\n\\nAo inv\xe9s de mais uma lista de projetos populares, decidi transformar minha dor em algo que movesse a aten\xe7\xe3o das pessoas para al\xe9m dos projetos que elas usam: para quem os mant\xeam.\\n\\nMais que projetos, conhe\xe7a pessoas incr\xedveis \ud83c\udde7\ud83c\uddf7\\n\\nE funcionou: mesmo sem nunca ter colocado um \xfanico centavo em an\xfancios, zero parcerias ou divulga\xe7\xf5es, o site da [Awesome You](https://awesomeyou.io/) j\xe1 teve mais de **40 mil acessos \xfanicos** at\xe9 aqui \ud83d\udd25\\n\\n_N\xe3o s\xf3 isso, a iniciativa conta com pessoas incr\xedveis. Vale a pena conhecer de verdade_ \ud83e\udef6\ud83c\udffb\\n\\n<hr />\\n\\nAl\xe9m disso, tamb\xe9m entrei oficialmente para a NodeBR \ud83d\udc22\u2728\\n\\n<hr />\\n\\n## MAR\xc7O 2025 \ud83d\udc37\\n\\n<img src=\'/img/articles/2025/retrospective/03.png\' />\\n\\n> GitHub Brasil: Open Source Friday, 14/03/2025 \u2014 Pachi Parra e eu.\\n\\nMinha primeira palestra do ano foi, simplesmente, no canal oficial do [GitHub Brasil](https://www.linkedin.com/company/github-brazil/posts/?feedView=all), mostrando o [Poku](https://poku.io/) na pr\xe1tica, com direto a Live Coding e at\xe9 perguntas abertas sobre open source.\\n\\nInclusive, foi a Live de estreia do programa Open Source Friday, com a [\ud83e\udd51 Pachi Parra](https://www.linkedin.com/in/pachicodes/) \ud83c\udf89\\n\\nMeu maior impacto vem especificamente do **GitHub**, onde todos meus projetos open source est\xe3o hospedados. Agora pensa na felicidade que foi poder estrear o programa, sentir a recep\xe7\xe3o das pessoas que estavam ali assistindo e o pessoal fazendo at\xe9 meme do **Poku** maromba \ud83d\ude02\\n\\n\u2014 _Ali\xe1s, est\xe1 faltando um GitHub Stars aqui hein?_ \ud83d\ude05\\n\\n<hr />\\n\\n## MAIO 2025 \ud83c\udfc6\\n\\n<img src=\'/img/articles/2025/retrospective/04.png\' width={480} />\\n\\n> \ud83c\udfc6 Unboxing Microsoft MVP Award 2025 com Roberto e eu.\\n\\n\xc0s 4 horas da manh\xe3 em ponto, dia 1\xba de Maio, recebi o e-mail dizendo que fui aceito no programa **Microsoft MVP**.\\n\\nEssa foi a primeira e provavelmente a maior prova que **impacto de fato leva ao reconhecimento** \ud83c\udf96\ufe0f\\n\\nA parte mais legal?\\n\\n**100%** das minhas contribui\xe7\xf5es envolvem diretamente o open source e como meus projetos e contribui\xe7\xf5es impactam o ecossistema **Microsoft** em diversos n\xedveis, especialmente:\\n\\n- **GitHub**, **TypeScript** & **Node.js** e **Azure**.\\n\\n<hr />\\n\\nAinda em maio, recebi uma men\xe7\xe3o realmente inesperada ap\xf3s um coment\xe1rio no **YouTube**:\\n\\n<img src=\'/img/articles/2025/retrospective/05.png\' width={480} />\\n\\n> Deyvid Nascimento em Live na Faculdade Impacta Digital.\\n\\n:::note \\"Toda vez que eu penso em open source, eu lembro dele.\\" \u2014 [Deyvid Nascimento](https://www.linkedin.com/in/deyvidnascimento/) (nosso querido [mano deyvin](https://www.linkedin.com/company/chorume/posts/?feedView=all)) \ud83e\udd18\ud83c\udffb\\n:::\\n\\nAqui voc\xea percebe como as coisas mudaram completamente de **2024** para **2025**? \ud83d\udd25\\n\\n<hr />\\n\\n## JUNHO 2025 \ud83d\uddfb\\n\\nPela primeira vez na vida:\\n\\n- Visitei outro pa\xeds (**Cusco**) \ud83c\uddf5\ud83c\uddea\\n- Vi e toquei na **neve** \u2744\ufe0f\\n- Alimentei **Lhamas** e **Alpacas** \ud83e\udd99\\n- Senti temperaturas abaixo de **0 \xbaC** \ud83e\udd76\\n- Escalei **montanhas** _(esse foi sofrido, hehe)_\\n\\nAl\xe9m da minha esposa, viajar com pessoas t\xe3o queridas como o [Erick Wendel](https://www.linkedin.com/in/erickwendel/) e a [Ana Neri](https://www.linkedin.com/in/ananeridev/) foi o que tornou tudo ainda mais especial.\\n\\nSimplesmente um dia acompanho essas duas refer\xeancias pela tela do meu computador e, do nada, me vejo passeando mundo a fora com eles \ud83d\ude02\\n\\nDo lugar mais sincero que existe dentro de mim, essa amizade inesperada \xe9 o maior presente que 2025 me deu \ud83d\udc9a\ud83e\ude77\ud83d\udc99\\n\\n<img src=\'/img/articles/2025/retrospective/06.png\' width={480} />\\n\\n> \ud83c\uddf5\ud83c\uddea Laguna Humantay: Erick Wendel, Ana Neri, Micaele (minha esposa, que n\xe3o tem LinkedIn) e eu.\\n\\n<hr />\\n\\n<img src=\'/img/articles/2025/retrospective/07.png\' />\\n\\n> Microsoft Reactor.\\n\\nOrganizei meu primeiro evento pela [NodeBR](https://www.linkedin.com/company/nodebr/) e [Awesome You](https://awesomeyou.io/).\\n\\nUma curiosidade:\\n\\n- O evento foi exatamente no mesmo local da minha primeira palestra, na **Microsoft Reactor** \ud83d\udc1d\\n\\n<hr />\\n\\n## JULHO 2025 \ud83d\udc3c\\n\\n<img src=\'/img/articles/2025/retrospective/08.png\' />\\n\\n> Codecon Summit, 19/07/2025\\n\\nNo dia 19 de Julho, realizei minha maior palestra do ano, com mais de **500 pessoas** presencialmente.\\n\\n<img src=\'/img/articles/2025/retrospective/09.png\' />\\n\\n> Codecon Summit, 19/07/2025 na perspectiva do palestrante.\\n\\nA parte mais legal de ter lotado, \xe9 que n\xe3o era uma palestra sobre _hype_ ou **Intelig\xeancia Artificial**: era uma palestra desmontando um projeto open source que desenvolvi do total zero e ensinando a criar... Um executor de testes \ud83d\ude05\ud83e\uddea\\n\\nMas n\xe3o era aleat\xf3rio: o tema do evento era literalmente** \\"Embrace the Hacker Way\\", **na [Codecon](https://www.linkedin.com/company/codecondev/posts/?feedView=all) Summit.\\n\\n_Se voc\xea gosta de palestrar, presta aten\xe7\xe3o nessa pr\xf3xima parte_ \u2b07\ufe0f\\n\\nQuero deixar um agradecimento \xe0 parte aqui para o [Marcel dos Santos](https://www.linkedin.com/in/marcelgsantos/) que me fez repensar ainda mais nos m\xednimos detalhes no momento de submeter palestras, onde literalmente tudo importa, por exemplo:\\n\\n- Portf\xf3lio est\xe1 atualizado? Funciona? Faz sentido com a imagem que voc\xea quer transmitir?\\n- \xc9 f\xe1cil encontrar suas contribui\xe7\xf5es e projetos?\\n- Como n\xf3s impactamos e nos comunicamos com a comunidade de desenvolvedores?\\n- A palestra est\xe1 alinhada com o tema do evento?\\n\\nPercebe que vai muito al\xe9m de s\xf3 submeter o conte\xfado e esperar? \ud83d\udca1\\n\\n_Bem, nada mais justo que voltar a agradecer o [Gabriel Nunes](https://www.linkedin.com/in/gabrielnunes/) por ter tornado um dos eventos mais incr\xedveis da minha vida em realidade_ \ud83e\udef0\ud83c\udffb\\n\\n<hr />\\n\\n<img src=\'/img/articles/2025/retrospective/10.png\' />\\n\\n> Papinho Tech, 09/07/2025 \u2014 YouTube e Spotify.\\n\\nFui convidado pela primeira para participar de um **Podcast**, o [Papinho Tech](https://www.linkedin.com/company/papinhotech/posts/?feedView=all) do [Gustavo Caetano](https://www.linkedin.com/in/oguscaetano/).\\n\\nInclusive, [vale a pena ver de novo](https://www.youtube.com/watch?v=rdtgG6AAuIA) \ud83c\udfa7\\n\\n<hr />\\n\\n## AGOSTO 2025 \ud83c\udf81\\n\\nDiferente de todas as palestras anteriores, onde eu mesmo submetia cada uma delas e aguardava pela curadoria, essa foi a primeira vez que recebi um convite para palestrar em um evento.\\n\\n<img src=\'/img/articles/2025/retrospective/11.jpeg\' />\\n\\n> EACH-USP: Semana de Sistemas da Informa\xe7\xe3o\\n\\nO mais legal: era o m\xeas do meu anivers\xe1rio. Ent\xe3o, o [Estevon Biazussi Bonai](https://www.linkedin.com/in/estevon-biazussi-bonai-b0188b302/) acabou dando meu primeiro presente de anivers\xe1rio \u2728\\n\\nDe todas palestras que j\xe1 realizei, essa foi a que mais recebi perguntas ap\xf3s finalizar: **foram mais de 15 minutos de perguntas e respostas**.\\n\\nObrigado pela paci\xeancia, [Information Systems\' Week](https://www.linkedin.com/company/semandesi/posts/?feedView=all)! Espero que pra tantas perguntas, o pessoal deva ter curtido o conte\xfado \ud83d\ude02\\n\\nE pra fechar com chave de ouro:\\n\\n- **Foi minha primeira vez encerrando um evento** \ud83e\udd18\ud83c\udffb\ud83d\ude0e\\n- Por outro lado, pensa a press\xe3o de palestrar logo na sequ\xeancia do [Professor Isidro PhD](https://www.linkedin.com/in/professor-isidro-phd/) \ud83d\ude05\\n\\n<hr />\\n\\n## SETEMBRO 2025 \ud83c\udf0a\\n\\n<img src=\'/img/articles/2025/retrospective/12.jpeg\' />\\n\\n> Roga DX: o maior evento de tecnologia do Nordeste\\n\\nImagina palestrar sobre temas t\xe3o delicados, como:\\n\\n- Exposi\xe7\xe3o de Dados\\n- Vulnerabilidades\\n- Consequ\xeancias que levam ao risco de vida dos usu\xe1rios\\n- Trazendo casos reais de vulnerabilidades que levaram ao cyberbullying e envolveu uma das comunidades mais perigosas da internet e o **FBI** \ud83d\udea8\\n\\n... E simplesmente a **Secretaria de Tecnologia do pr\xf3prio GOVERNO DE ALAGOAS** compartilhar sua palestra \ud83e\udd2f\\n\\nE como se n\xe3o pudesse melhorar, simplesmente gravei um **Podcast** numa sala de vidro no [Roga DX](https://www.linkedin.com/company/rogadx/posts/?feedView=all) com o [Gustavo Guanabara](https://www.linkedin.com/in/guanabara/), uma das maiores inspira\xe7\xf5es da minha vida \ud83d\udd96\\n\\n<img src=\'/img/articles/2025/retrospective/13.png\' width={480} />\\n\\n> Roga DX: uma pessoa muito feliz e o Gustavo Guanabara.\\n\\nImagina ter a oportunidade de compartilhar experi\xeancias e conhecimentos atrav\xe9s do open source com as pessoas que voc\xea mais admira.\\n\\n- Aqui eu percebi a import\xe2ncia de trazer conte\xfados que v\xe3o al\xe9m do c\xf3digo e conversam diretamente com a vida real.\\n- Como ter um **networking de qualidade** nos leva a lugares e pessoas inimagin\xe1veis.\\n- _Curtir uma praia \xe0s vezes \xe9 bom_ \ud83d\ude0c\\n\\n<hr />\\n\\n### Realizei minha primeira palestra em dupla:\\n\\n<img src=\'/img/articles/2025/retrospective/14.jpeg\' />\\n\\n> TDC S\xe3o Paulo: Larissa Azevedo e eu.\\n\\nTem uma curiosidade/estrat\xe9gia bem interessante aqui _(e um pouco de cultura)_:\\n\\nNo ano passado eu entrei para a mentoria da [Larissa Azevedo](https://www.linkedin.com/in/larissasazevedo/), n\xe3o com intuito da mentoria em si, mas de me aproximar de algu\xe9m que realiza diversas palestras nos mais diversos lugares e ela topou o \\"desafio\\".\\n\\nMinha inten\xe7\xe3o era simples:\\n\\n- Estar perto de algu\xe9m que est\xe1 perto de pessoas que eu quero me aproximar.\\n- De b\xf4nus, participar e aprender com uma comunidade realmente acolhedora.\\n\\nEu sabia que eventualmente conseguiria chegar a diversos lugares sozinho, mas sabe aquele ditado?\\n\\n:::note Se quer ir r\xe1pido, v\xe1 sozinho. Se quer ir longe, v\xe1 acompanhado.\\n:::\\n\\nNada de frases de coaching aqui: esse ditado leva \xe0 filosofia africana [_**\\"Eu sou porque n\xf3s somos\\"**_](https://cienciaviva.org.br/ubuntu-eu-sou-porque-nos-somos/), inspira\xe7\xe3o por tr\xe1s da cria\xe7\xe3o do **Ubuntu** (sim, o sistema operacional).\\n\\nE essa foi minha principal estrat\xe9gia para **2025**:\\n\\n- Caminhar junto de quem j\xe1 viveu o que eu quero viver, de quem j\xe1 trilhou os caminhos que eu quero trilhar.\\n\\nDito isso, o que come\xe7ou com _\\"estar perto [...]\\"_, levou a duas palestras em dupla com a pessoa que confiei essa estrat\xe9gia e que acabou confiando em mim de volta \u2728\\n\\n<hr />\\n\\n## NOVEMBRO 2025 \ud83d\ude31\ud83c\udf1f\\n\\n<img src=\'/img/articles/2025/retrospective/15.png\' />\\n\\n- [**O Poku bate mais de 100 mil downloads por ano**](https://www.linkedin.com/posts/wellwelwel_o-poku-bateu-a-marca-de-100-mil-downloads-activity-7395833452207599616-xeO3/) (mais de **150 mil** no total bruto).\\n- [**A soma de todos meus projetos open source ultrapassam 200 milh\xf5es por ano**](https://www.linkedin.com/posts/wellwelwel_infelizmente-minha-maior-expectativa-para-activity-7400112046891163648-XDq8/) (**233 milh\xf5es** atualmente e quase **280 milh\xf5es** no total bruto).\\n\\nEssa era minha meta para, _s\xf3 quem sabe_, o final de **2026**:\\n\\n- N\xe3o chegou nem **dezembro de 2025** e j\xe1 era \ud83d\ude02\\n\\n<hr />\\n\\n## DEZEMBRO 2025 \ud83e\udd20\\n\\n### Realizei minha primeira mentoria e claro que foi sobre open source:\\n\\n<img src=\'/img/articles/2025/retrospective/16.jpeg\' />\\n\\n> DevFest Cerrado, 13/12/2025: Mentoria aberta sobre open source.\\n\\nPara fechar o ano com estilo, eu queria fazer um paralelo com **2024** e, com um agradecimento em especial ao [Wendel Marques](https://www.linkedin.com/in/wendelmarques/), tive a oportunidade de tornar isso poss\xedvel:\\n\\n- Finalizar **2025** palestrando no mesmo evento que finalizei **2024**: o **DevFest Cerrado** do [GDG Goi\xe2nia](https://www.linkedin.com/company/gdggoiania/posts/?feedView=all) \u2728\\n\\n<img src=\'/img/articles/2025/retrospective/17.jpeg\' />\\n\\n> DevFest Cerrado, 13/12/2025: Minha \xfaltima palestra do ano.\\n\\n<hr />\\n\\nQuero deixar um agradecimento especialmente especial para minha esposa, que me acompanhou em toda essa jornada.\\n\\n<hr />\\n\\n<img src=\'/img/articles/2025/retrospective/18.png\' width={480} />\\n\\nClaro que n\xe3o teria nem como colocar tudo aqui, mas se voc\xea me acompanha, certamente deve ter visto o que n\xe3o coube aqui \ud83e\udef0\ud83c\udffb\\n\\n- Se voc\xea organiza eventos e chegou at\xe9 aqui, **vou ficar muito feliz de ser convidado para o seu evento** \ud83c\udfa4\\n\\nMuito obrigado se algu\xe9m teve coragem de chegar at\xe9 aqui, nenhuma letra sequer foi escrita por IA, _I swear_!\\n\\n- Tudo \xe9 **100%** humano e cada m\xednimo caractere foi escrito manualmente por mim _(incluindo os travess\xf5es \u2014 <kbd>shift</kbd> + <kbd>opt</kbd> + <kbd>-</kbd>)_.\\n\\n### E que venha 2026! \ud83e\udd18\ud83c\udffb\ud83d\udd25\\n","filePath":"article.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/articles/2025/12/article.mdx","summary":[{"text":"NOVEMBRO 2024: Nos cap\xedtulos anteriores \ud83d\udca1","level":2,"items":[]},{"text":"Spoilers \ud83c\udf7f","level":2,"items":[]},{"text":"JANEIRO 2025 \ud83c\udf93","level":2,"items":[]},{"text":"MAR\xc7O 2025 \ud83d\udc37","level":2,"items":[]},{"text":"MAIO 2025 \ud83c\udfc6","level":2,"items":[]},{"text":"JUNHO 2025 \ud83d\uddfb","level":2,"items":[]},{"text":"JULHO 2025 \ud83d\udc3c","level":2,"items":[]},{"text":"AGOSTO 2025 \ud83c\udf81","level":2,"items":[]},{"text":"SETEMBRO 2025 \ud83c\udf0a","level":2,"items":[{"text":"Realizei minha primeira palestra em dupla:","level":3,"items":[]}]},{"text":"NOVEMBRO 2025 \ud83d\ude31\ud83c\udf1f","level":2,"items":[]},{"text":"DEZEMBRO 2025 \ud83e\udd20","level":2,"items":[{"text":"Realizei minha primeira mentoria e claro que foi sobre open source:","level":3,"items":[]},{"text":"E que venha 2026! \ud83e\udd18\ud83c\udffb\ud83d\udd25","level":3,"items":[]}]}],"description":"Entre **pr\xeamios**, **amizades**, **12 palestras**, n\xfameros **massivos** que ultrapassaram **230 MILH\xd5ES de downloads** em projetos autorais e v\xe1rias **primeiras vezes**, 2025 me levou a lugares t\xe3o incr\xedveis, que facilmente eu poderia manter as coisas assim pra sempre.\\n\\n- Espero que minha hist\xf3ria te inspire e que voc\xea escolha ir muito al\xe9m da zona de conforto \ud83e\udd18\ud83c\udffb","social":"./banner.png","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/articles/2025/12/banner.png","readingTime":10,"lastModified":"2026-02-28T23:41:30.000Z","authorsData":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, Microsoft MVP, mantenedor do MySQL2 e criador do Poku \u2728","url":"https://weslley.io","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"nextArticle":{"title":"Introduzindo Testes Unit\xe1rios para Devs Iniciantes","slug":"introduzindo-testes-unitarios-para-devs-iniciantes","description":"Se voc\xea \xe9 um desenvolvedor iniciante (_ou n\xe3o_), eu quero te mostrar que testes podem sim ser simples e que a complexidade s\xf3 vem conforme nossa pr\xf3pria necessidade, n\xe3o do _tester_.","social":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/articles/2024/01/banner.png"},"route":"articles"}')}}]);